import logo from './hiish.svg';
import profile from './profile.jpg';
import plus from './plus.svg';
import search from './search.svg';

function Navbar() {
  return (
    <div className="w-1/4">
              <img className="mx-auto" src={profile}/>
              <img src={logo}/>
          <div>
              <div>
                  <img className="stroke-2" src={plus}/>
                  <img src={search}/>
              </div>
          </div>
    </div>
  );
}

export default Navbar;
